{"operationName":"ArtistFull","variables":{"artistId":"756737","relatedArtistFirst":6},"query":"query ArtistFull($artistId: String!, $relatedArtistFirst: Int!) {
  artist(artistId: $artistId) {
    ...ArtistFull
    relatedArtists: relatedArtist(first: $relatedArtistFirst) {
      edges {
        cursor
        node {
          ...ArtistBase
          __typename
        }
        __typename
      }
      pageInfo {
        hasNextPage
        hasPreviousPage
        startCursor
        endCursor
        __typename
      }
      __typename
    }
    __typename
  }
}

fragment ArtistFull on Artist {
  ...ArtistMasthead
  __typename
}

fragment ArtistMasthead on Artist {
  ...ArtistBase
  ...ArtistBio
  ...ArtistSocial
  onTour
  status
  __typename
}

fragment ArtistBase on Artist {
  id
  name
  fansCount
  hasSmartRadio
  picture {
    small: urls(pictureRequest: {width: 100, height: 100})
    medium: urls(pictureRequest: {width: 264, height: 264})
    large: urls(pictureRequest: {width: 500, height: 500})
    copyright
    explicitStatus
    __typename
  }
  __typename
}

fragment ArtistBio on Artist {
  bio {
    full
    __typename
  }
  __typename
}

fragment ArtistSocial on Artist {
  social {
    twitter
    facebook
    website
    __typename
  }
  __typename
}
"}
